import { load } from "cheerio";
export function rakingAuthorsScrap(html) {
    const $ = load(html);
    const data = $("#topautores > ul > li >")
        .slice(0, 9)
        .map((i, e) => {
        return {
            avatar_url: $(e).find("img").attr("src") || "",
            href: $(e).attr("href") || "",
            name: $(e).attr("title") || "",
            position: i++,
        };
    })
        .toArray();
    return data;
}
